Hi, Donald. To modify the `nextOccurrence` method of the `DateRange` class to handle events that occur on certain days of the week, you can add a new property to the `DateRange` class called `dayOfWeek` and use a switch statement to calculate the next occurrence based on the frequency and day of the week.

Here's an updated version of the `DateRange` class with support for weekly events with specific days:

```swift
import Foundation

enum Frequency: String {
    case daily, weekly, monthly, yearly
}

enum DayOfWeek: String {
    case monday, tuesday, wednesday, thursday, friday, saturday, sunday
}

class DateRange {
    let start: Date
    let end: Date
    var frequency: Frequency?
    var dayOfWeek: DayOfWeek?

    init(start: Date, end: Date, frequency: Frequency? = nil, dayOfWeek: DayOfWeek? = nil) {
        self.start = start
        self.end = end
        self.frequency = frequency
        self.dayOfWeek = dayOfWeek
    }

    func nextOccurrence(after date: Date) -> Date? {
        guard let frequency = self.frequency, let dayOfWeek = self.dayOfWeek else {
            return nil
        }

        let calendar = Calendar.current
        let component = Calendar.Component.date

        do {
            let nextDate = try calendar.date(byAdding: component, value: 1, to: date, options: [.dayCalendar, .weekCalendar])

            switch frequency {
            case .daily:
                return nextDate
            case .weekly:
                let weekday = calendar.component(component: .weekday, from: date)
                let daysToAdd = weekday - DayOfWeek.monday + 1
                return try calendar.date(byAdding: component, value: daysToAdd, to: date, options: [.dayCalendar, .weekCalendar])
            case .monthly:
                // calculate next monthly occurrence
                break
            case .yearly:
                // calculate next yearly occurrence
                break
            }
        } while nextDate <= end

        return nil
    }
}
```

This updated `DateRange` class includes a `dayOfWeek` property and a modified `nextOccurrence` method that handles weekly events with specific days. The `nextOccurrence` method now calculates the next occurrence based on the frequency and day of the week, taking into account the given start date.

You can now create a `DateRange` instance with a weekly frequency and a specific day of the week like this:

```swift
let event = DateRange(start: startDate, end: endDate, frequency: .weekly, dayOfWeek: .monday)
```

This will create an event that occurs every Monday until the end date.

